sys_variable_value.value:
(function execute(inputs, outputs) {
  inputs = new GoogleDirectoryUtils().trimStringInputs(inputs);
  outputs.customer = inputs.customer;
  outputs.domain = inputs.domain;
  outputs.maxResults = inputs.maxResults;
  outputs.userKey = inputs.userKey;
})(inputs, outputs);

